    const [checked, setChecked] = useState(false);

    return (
        <form>
            <input
                type="text"
                value={name}
                onChange={(e) => setName(e.target.value)}
                placeholder="Full name"
                aria-label="fullname"
            ></input>
            <label>
                <input
                    type="checkbox"
                    checked={checked}
                    onChange={(e) => setChecked(e.target.checked)}
                />{" "}
                Instructor?
            </label>
            <input type="submit" value="Submit"></input>
        </form>    
    );
};

export default Form2;
